INSERT INTO `t_content` VALUES (1, '基于SSM的个人博客系统1.0', '<p>闲来没事，用SSM（SpringMVC+Spring+mybatis）开发了一个个人博客系统，前端模板是从网上找的。地址&rarr;<a href=\"http://www.yangqq.com\">杨青博客</a>。通过Maven管理项目。极大的程度上降低了环境的配置难度。</p>\r\n\r\n<p>项目总体目录如图：</p>\r\n\r\n<p><a href=\"ja\"><img alt=\"\" src=\"https://wx3.sinaimg.cn/mw1024/9ea44a83gy1fusqm4a53lj20890ftwez.jpg\" style=\"height:569px; width:297px\" /></a></p>\r\n\r\n<p>首页是这样的：</p>\r\n\r\n<p><img alt=\"\" src=\"https://wx1.sinaimg.cn/mw1024/9ea44a83gy1fusqt75nxaj20z10fbx0f.jpg\" style=\"height:270px; width:566px\" /></p>\r\n\r\n<p>实现的功能也都很简单，就是些简单的文章的浏览，评论，和网站留言。以及我个人的文章的发布，因为是个人博客，目前不开放用户注册~后续功能还在不断完善。希望自己能够不断进步吧。</p>\r\n\r\n<p>有想要源码的同学，可以联系我。</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '2018-08-31 12:00:09', 1, '个人博客', 75, 1, '1', 'https://wx2.sinaimg.cn/mw1024/9ea44a83ly1fmxqfzjgx7j21hc0vgai1.jpg');
